import React, { Component } from "react";
import ProfileTask from "./ProfileTasks/ProfileTask";

class CVBacklog extends Component {
  render() {
    const { profile_tasks_prop } = this.props;

    const tasks = profile_tasks_prop.map(profile_task => (
      <ProjectTask key={profile_task.id} project_task={project_task} />
    ));

    let todoItems = [];

    for (let i = 0; i < tasks.length; i++) {
      if (tasks[i].props.profile_task.status === "TO_DO") {
        todoItems.push(tasks[i]);
      }
    }

    return (
      <div className="container">
        <div className="row">
          <div className="col-md-12">
            <div className="card text-center mb-2">
              <div className="card-header bg-secondary text-white">
                <div>Experiences</div>
              </div>
            </div>
            {todoItems}
            {
              // insert tasks here
            }
          </div>
        </div>
      </div>
    );
  }
}

export default CVBacklog;
